function initialize() {

    var mapOptions = {
        zoom: 8,
        mapTypeId: google.maps.MapTypeId.ROADMAP,
        // center: new google.maps.LatLng(10,10)
    };

    //  map = new google.maps.Map(document.getElementById("map"), mapOptions);

    initializeMarker();
}

function initializeMarker() {

    if (navigator.geolocation) {
        navigator.geolocation.getCurrentPosition(function (position) {
            var pos = new google.maps.LatLng(position.coords.latitude, position.coords.longitude);

            latPosition = position.coords.latitude;
            longPosition = position.coords.longitude;

            marker = new google.maps.Marker({
                position: pos,

                // animation: google.maps.Animation.DROP,
                map: map,
                icon: 'http://theonlytutorials.com/demo/x_office_calendar.png'
            });

            map.setCenter(pos);

        });
    }




}

function showVehicleInfo(vehicleInfo) {
    var vehicle=vehicleInfo;

    vehicleInfo = "<table>";
    vehicleInfo += "<tr><td class='Col1'>" + "IMEI" + "</td><td class='Col2'>:</td><td class='Col3'>"
        + vehicle.v_IMEI + "</td></tr>";
    vehicleInfo += "<tr><td class='Col1'>" + "HIZ" + "</td><td class='Col2'>:</td><td class='Col3'>"
        + vehicle.v_HIZ + "</td></tr>";
    vehicleInfo += "<tr><td class='Col1'>" +"TARIH SAAT" + "</td><td class='Col2'>:</td><td class='Col3'>"
        +  vehicle.v_TARIH + " "+vehicle.v_SAAT + "</td></tr>";
    vehicleInfo += "<tr><td class='Col1'>" + 'group' + "</td><td class='Col2'>:</td><td class='Col3'>"
        + vehicle.groupName + "</td></tr>";
    vehicleInfo += "<tr><td class='Col1'>" + 'speed' + "</td><td class='Col2'>:</td><td class='Col3'>"
        + vehicle.speed
        + "&nbsp;"
        + vehicle.spdType
        + "</td></tr>";
    vehicleInfo += "<tr><td class='Col1'>" + 'statusExplain' + "</td><td class='Col2'>:</td><td class='Col3'>"
        + vehicle.statusExplain
        + "</td></tr>";
    vehicleInfo += "<tr><td class='Col1'>" + 'dailyDistance' + "</td><td class='Col2'>:</td><td class='Col3'>"
        + vehicle.dailyDistance
        + "&nbsp;"
        + vehicle.distType + "</td></tr>";
    vehicleInfo += "<tr><td class='Col1'>" + 'distance' + "</td><td class='Col2'>:</td><td class='Col3'>"
        + vehicle.distance
        + "&nbsp;"
        + vehicle.distType
        + "</td></tr>";
    vehicleInfo += "<tr><td class='Col1'>" + 'positionDate' + "</td><td class='Col2'>:</td><td class='Col3'>"
        + vehicle.positionTime + "</td></tr>";
    vehicleInfo += "<tr><td class='Col1 addressCol'>" + 'address' + "</td><td class='Col2'>:</td><td class='Col3'>"
        + vehicle.address + "</td></tr>";
    vehicleInfo += "</table>";

    return vehicleInfo;
}

